import {gql} from "@apollo/client"

export const GetDish = gql`
query ($id: String!) {
  gerechtBy(id: $id) {
    id
    slug
    uri
    gerechtmeta {
      origin
      description
      profilePicture {
        sourceUrl
        title
      }
    }
  }
}
`
